import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const titles = ["Breaking bad", "Narcos", "Game of Thrones"];

const MovieList = (props) => (
  <ul>
    {
      props.titles.map( title => 
        <li>{title}</li>
        )
    }
  </ul>
)

class App extends Component {
  render() {
    return (
      <div className="App">
        <MovieList></MovieList>
      </div>
    );
  }
}

export default App;
